import React from "react";
import Task from "./Task";


const TasksFilterAll =({classNames,onAllVision}) =>  {


            return (
            <li className={classNames}>
                 <button
                    onClick = {() => onAllVision()}>
                    All
                 </button>
             </li>);
};

const TasksFilterCompleted =({onCompletedVision,classNames}) =>  {
    return (
        <li >
            <button
                onClick = {()=>onCompletedVision()}>
                Completed
            </button>
        </li>);
};

const TasksFilterActive =({onActiveVision,classNames}) =>  {



    return (
        <li className={classNames}>
            <button
                onClick = {()=>onActiveVision()}>
                Active
            </button>
        </li>);
};

const TasksFilterClear =({onClearCompleted}) => {
        return (
            <button
                onClick = {()=>onClearCompleted()}>
                Clear Completed
            </button>
        );
};

export {
    TasksFilterAll,TasksFilterCompleted,TasksFilterActive,TasksFilterClear
}
